import React from 'react';
import DeleteOutlineIcon from '@material-ui/icons/DeleteOutline';
const Notes = (props) => {
  return (
    <>
      <div className="notex">
        <h2>{props.title}</h2>
        <p>{props.content}</p>
        <button
          onClick={() => {
            props.deleteIcon(props.id);
          }}
        >
          <DeleteOutlineIcon />
        </button>
      </div>
    </>
  );
};

export default Notes;
